import React from "react";
import styled from "styled-components";
import gitLogo from "../misc/images/github.png";
import scatterPng from "../misc/images/Scatter_Main.png";
import Button from "./Button";
import {Scatter} from "./Scatter";
import {ReactComponent as LaptopC} from "../misc/images/laptopC++.svg";

const ProjectWrapper = styled.div`
    width: 75vw;
    height: 35vh;
    background-color: ${props => props.theme.colors.accentBackground};
    z-index: 1;
    display: flex;
    flex-flow: row;
    justify-content: center;
    align-items: center;
    box-shadow: 2px 2px 2px 1px #181b21;
`;

const ImageWrapper = styled.div`
  width: 50%;
  height: 100%;
  background-color: red;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const TextWrapper = styled.div`
  width: 50%;
  height: 100%;
  background-color: green;
`;

const StyledLaptop = styled(LaptopC)`
`;

const Project = (props) => {

    return (
        <ProjectWrapper>
            <Scatter ScatterSource={scatterPng} height={50} width={15}/>
            <ImageWrapper>
                <StyledLaptop width={"100%"} />
            </ImageWrapper>
            <TextWrapper />
        </ProjectWrapper>
    )
};



